import React from "react";

class GetInTouch extends React.Component {
  render() {
    return (
      <div
        id="getintouch"
        style={MainDiv}
        data-aos="fade-down"
        data-aos-duration="9000"
      >
        <div style={Heading}>
          <div>Get in touch</div>
        </div>
        <div className=" row d-flex justify-content-center">
          <div
            className="card"
            data-aos="zoom-in"
            style={{
              width: "70%",
              height: "250px",
              border: "none",
              marginBottom: "20px",
              display: "flex",
              flexDirection: "column",
              justifyContent: "space-around",
              alignItems: "center",
              borderStyle: "solid",
              borderColor: "#193964",
              borderWidth: "5px",
            }}
          >
            <div>Want to know more about me ?</div>
            <div style={{}}>
              <div className="Connect " style={{ width: "230px" }}>
                Grab my resume
              </div>
              <div className="Connect" style={{ width: "230px" }}>
                Send an Email
              </div>
            </div>
          </div>
        </div>
      </div>
    );
  }
}
const MainDiv = {
  marginTop: "70px",
};

const Heading = {
  justifyContent: "center",
  display: "flex",
  fontWeight: "bold",
  fontSize: "40px",
  fontFamily: "playfair display",
  color: "#193964",
  padding: "3%",
};

export default GetInTouch;
